async function fetchData(produk) {
let okeUrl = {
  pulsa: `https://okeconnect.com/harga/json?id=${global.ord_harga_id}&produk=pulsa`,
  transfer: `https://okeconnect.com/harga/json?id=${global.ord_harga_id}&produk=pulsa_transfer`,
};
  try {
    const response = await fetch(okeUrl[produk]);
    const result = await response.json();
    
    // Sort the result by price in ascending order
    result.sort((a, b) => parseInt(a.harga) - parseInt(b.harga));

    return result;
  } catch (error) {
    console.error(`Error fetching ${produk} list:`, error);
    throw `Terjadi kesalahan saat mengambil daftar ${produk}.`;
  }
}

async function donghua_list(page) {
    try {
        var { data } = await axios.get("https://v5.animasu.cc" + "/genre/donghua/page/" + page)
        var title = [], status = [], epsd = [], type = [], url = [], img = [], result = [], $ = cheerio.load(data)
        
        $(".tt").each(function(a, b) {
            let x = $(b).text().trim()
            title.push(x)
        })
        
        $('.bt .sb').each((a, b) => {
            let x = $(b).text()
            status.push(x)
        })
        
        $('.bt .epx').each((a, b) => {
            let x = $(b).text().trim()
            epsd.push(x)
        })
        
        $('.typez').each((a, b) => {
            let x = $(b).text().trim()
            type.push(x)
        })
        
        $(".bsx a").each(function(a, b) {
            let x = $(b).attr("href")
            url.push(x)
        })
        
        $('.postbody img').each((a, b) => {
            let x = $(b).attr('data-src')
            img.push(x)
        })
        
        for (let i = 0; i < title.length; i++) {
            result.push({
                title: title[i],
                status: status[i],
                epsd: epsd[i],
                type: type[i],
                url: url[i],
                img: img[i]
            })
        }

        return { data: result }
    } catch (error) {
        console.error(error)
        return { data: [], error: 'Terjadi kesalahan saat mengambil data donghua.' }
    }
}

